DECLARE
    nuPosterior number;
    nuLogPosterior number;
	nuQi number;
BEGIN
   DBMS_OUTPUT.put_line ('INICIO');

   -- Inizializate cardianality of values sets for each variable
   pkBayesianMapper.tbR (1) := 3;
   pkBayesianMapper.tbR (2) := 3;
   pkBayesianMapper.tbR (3) := 3;
   pkBayesianMapper.tbR (4) := 3;
   pkBayesianMapper.tbR (5) := 3;
   pkBayesianMapper.tbR (6) := 3;

   --dbms_output.put_line('pkConjugate.fnuCallDDirichletR(1, 1):'||pkConjugate.fnuCallDDirichletR(1, 1)); -- 2.1875 / 2.34164177104221

   -- Clear pkConjugate.tbHyperparam
   pkConjugate.clearHypParam;
   
    -- Empty structure is initialized with hyperparamters value equal to 2
   pkConjugate.initHypParam;

   -- Save All tbHyperparam
   pkConjugate.saveAllHypParam;
   
    -- Initialize POWER_MATRIX With Original(power=0) And Empty Matrices (power=1)
    --pkHasting.Initialize;
    -- Load adjacency matrix (power one) without edges
    pkBayesianMapper.tbAdjacencyMatrix := pkBayesianMapper.ftbLoadMatrix (1);
    /*
    pkBayesianMapper.tbAdjacencyMatrix(2)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(4) := 1;
    */
    /*
    pkBayesianMapper.tbAdjacencyMatrix(1)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(4)(3) := 1;
    */
    /*
    pkBayesianMapper.tbAdjacencyMatrix(1)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(1)(4) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(4) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(4)(3) := 1;
    */
    /*
    pkBayesianMapper.tbAdjacencyMatrix(2)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(4) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(2) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(4) := 1;
    */
    pkBayesianMapper.tbAdjacencyMatrix(2)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(2)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(3)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(4)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(4)(2) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(4)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(2) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(5)(4) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(6)(1) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(6)(2) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(6)(3) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(6)(4) := 1;
    pkBayesianMapper.tbAdjacencyMatrix(6)(5) := 1;

    -- UPDATE FREQUENCY2 SET F=F-1; -- Undo pseudo counting
    --dbms_output.put_line(pkBayesianMapper.fnuGetN2(3,0,1));  --i,j,k)
    --dbms_output.put_line(pkBayesianMapper.fnuGetN2(3,1,1));  --i,j,k)

    --dbms_output.put_line('pkConjugate.fnuCallDDirichletR(3, 1):'||pkConjugate.fnuCallDDirichletR(3, 1)); -- 1.5
    
    /*
	pkConjugate.clearConjugate;
	pkConjugate.tbConjugate(3)(1) := pkConjugate.fnuPosteriorHelper(3,1);
    dbms_output.put_line('pkConjugate.tbConjugate(i=3,k=1):'||pkConjugate.tbConjugate(3)(1)); -- 353.448859331274
    */
    --dbms_output.put_line('pkConjugate.tbHyperparam(3)(1)(1):'||pkConjugate.tbHyperparam(3)(1)(1)); -- 127+2
    --dbms_output.put_line('pkConjugate.tbHyperparam(3)(2)(1):'||pkConjugate.tbHyperparam(3)(2)(1)); -- 9873+2
    --dbms_output.put_line('pkConjugate.fnuCallDDirichletR(3, 1):'||pkConjugate.fnuCallDDirichletR(3, 1)); -- 2.1875

    pkBayesianMapper.gblCPTcacheON := FALSE;
    --nuPosterior := pkConjugate.fnuPosterior (0);
    nuLogPosterior := pkConjugate.fnuLogPosterior (0);
    pkBayesianMapper.gblCPTcacheON := TRUE;

    --dbms_output.put_line('nuPosterior:'||nuPosterior);
    dbms_output.put_line('nuLogPosterior:'||nuLogPosterior);

	FOR i IN 1..pkBayesianMapper.tbR.COUNT LOOP
		nuQi := pkBayesianMapper.fnuGetQ(i);
		FOR k IN 1..nuQi LOOP
            --dbms_output.put_line('pkConjugate.tbConjugate('||i||')('||k||'):'||pkConjugate.tbConjugate(i)(k));
            dbms_output.put_line('pkConjugate.tbLogConjugate('||i||')('||k||'):'||pkConjugate.tbLogConjugate(i)(k));
        END LOOP;
    END LOOP;

   DBMS_OUTPUT.put_line ('FIN');
END;
